import Nav from "./Nav";
function Policies(){
    return(
        <body>
            <Nav/>
            <section class="bg-light text-dark p-5 ">
                <h1 class="text-warning"> Policies</h1>
                <h3 class="text-center ">Please Read the following before submitting an order</h3>
                <ol>
                    <li class="fs-5"><p>Please click "Add to order" after entering the quantity of each item</p></li>
                    <li class="fs-5"><p>Please click "Update order" after updating the quantity of an item</p></li>
                    <li class="fs-5"><p>Please do not leave order furm until you have submitted it.</p></li>
                </ol>
            </section>
        </body>
    );
}

export default Policies;
